import Box from '@material-ui/core/Box';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import React from 'react';

const activities = [
    { time: '9:00am', activity: 'Breakfast' },
    { time: '1:00pm', activity: 'Meet at park' },
    { time: '7:00', activity: 'Movie night' }
];

export default function DayContainer() {
    return (
        <Box border={1} color={black}>
            <Box borderBottom={1} borderColor='lightgrey'>
                <Typography>_DATE_</Typography>
            </Box>
            <Box>
                {activities.map(each => {
                    <Grid container display='flex' direction='row'>
                        <Typography>{each.time}</Typography>
                        <Typography>{each.activity}</Typography>
                    </Grid>
                })}
            </Box>
        </Box>
    )
}
